def is_prime(n, cache={}):
    """"""
    if n in cache:
        return cache[n]
    if n < 2:
        cache[n] = False
        return False
    for i in range(2, int(n ** 0.5) + 1):
        if n % i == 0:
            cache[n] = False
            return False
    cache[n] = True
    return True
